use alloy_primitives::{bytes::Buf, B256};

/// The offset in the blob to the payload envelope.
const BLOB_ENVELOPE_V7_OFFSET_PAYLOAD: usize = 5;

/// Decodes the input blob into a [`Batch`].
pub fn decode_v7(blob: &[u8]) -> Result<Batch, DecodingError> {
    // get blob iterator and collect, skipping unused bytes.
    let mut heap_blob = BlobSliceIter::from_blob_slice(blob).copied().collect::<Vec<_>>();
    let buf = &mut (&*heap_blob);

    // check buf len.
    check_buf_len!(buf, 1 + 3 + 1);

    // check version.
    let version = from_be_bytes_slice_and_advance_buf!(u8, buf);
    debug_assert!(
        (version == 7) || (version == 8) || (version == 9) || (version == 10),
        "incorrect blob version"
    );

    let blob_payload_size = from_be_bytes_slice_and_advance_buf!(u32, 3, buf) as usize;

    // check compression byte.
    let is_compressed = from_be_bytes_slice_and_advance_buf!(u8, buf);
    debug_assert!(is_compressed == 1 || is_compressed == 0, "incorrect compressed byte flag");

    // get payload body.
    let buf = &mut (heap_blob
        .get(BLOB_ENVELOPE_V7_OFFSET_PAYLOAD..blob_payload_size + BLOB_ENVELOPE_V7_OFFSET_PAYLOAD)
        .ok_or(DecodingError::Eof)?);

    // uncompress if necessary.
    let buf = if is_compressed == 1 {
        heap_blob = decompress_blob_data(buf);
        &mut heap_blob.as_slice()
    } else {
        buf
    };

    // decode the payload.
    decode_payload(version, buf)
}

pub(crate) fn decode_payload(version: u8, blob: &[u8]) -> Result<Batch, DecodingError> {
    let payload = decode_v7_payload(blob)?;
    Ok(Batch::new(version, None, payload))
}

/// Decode the blob data into a [`Batch`].
pub(crate) fn decode_v7_payload(blob: &[u8]) -> Result<PayloadData, DecodingError> {
    let buf = &mut (&*blob);

    // check buf len.
    check_buf_len!(buf, 64 + 8 + 2);

    // extract L1 messages queue hashes.
    let prev_message_queue_hash = B256::from_slice(&buf[0..32]);
    buf.advance(32);
    let post_message_queue_hash = B256::from_slice(&buf[0..32]);
    buf.advance(32);

    // get initial block number and block count.
    let initial_block_number = from_be_bytes_slice_and_advance_buf!(u64, buf);
    let blocks_count = from_be_bytes_slice_and_advance_buf!(u16, buf) as usize;

    let mut block_contexts: Vec<BlockContextV7> = Vec::with_capacity(blocks_count);
    let mut l2_blocks: Vec<L2Block> = Vec::with_capacity(blocks_count);

    // for each block, decode into a block context
    for _ in 0..blocks_count {
        let context = BlockContextV7::try_from_buf(buf)?;
        block_contexts.push(context);
    }

    // for each block context, decode the transactions
    for (i, context) in block_contexts.into_iter().enumerate() {
        let transactions_count = context.transactions_count();
        let mut transactions = Vec::with_capacity(transactions_count);
        for _ in 0..transactions_count {
            let tx = Transaction::try_from_buf(buf).ok_or(DecodingError::Eof)?;
            transactions.push(tx.0);
        }
        l2_blocks
            .push(L2Block::new(transactions, (context, initial_block_number + i as u64).into()));
    }

    Ok(PayloadData {
        blocks: l2_blocks,
        l1_message_queue_info: (prev_message_queue_hash, post_message_queue_hash).into(),
        skipped_l1_message_bitmap: None,
    })
}

